import React, { Suspense, useContext } from 'react';
import './assets/css/font.css';
import './assets/css/Reset.css';
import './App.css';
import { Header } from './Components/Header/Header';
import { Main } from './Components/Page/MainBlock/Main';
import { Contact } from './Components/Page/Contact/Contact';
import { Why } from './Components/Page/Why/Why';
import { Feature } from './Components/Page/Feature/Feature';
// import { Gallery } from './Components/Page/Gallery/Gallery';
import { Footer } from './Components/Footer/Footer';
import { Indicator } from './Components/Indicator/Indicator';

const Gallery = React.lazy(() => import('./Components/Page/Gallery/Gallery'));

export const ThemeContext = React.createContext('light');

export const lightTheme = {

  body: '',
  text: '#fff',
  title: '#1b1b1b',
  background: '',
  mainBlock: ''

}

// export const darkTheme = {

//   body: ‘# 363537’,

//   text: ‘# FAFAFA’,

//   toggleBorder: ‘# 6B8096’,

//   background: ‘# 999’,

// }

function App() {
  const darkTheme = useContext(ThemeContext);
  return (
    <ThemeContext.Provider value="light">
      <div className={darkTheme ? "wrapper dark" : "wrapper"}>
        <Indicator />
        <Header />
        <div className="page">
          <Main />
          <Why />
          <Feature />
          <Suspense fallback={<div>Loading...</div>}>
            <Gallery />
          </Suspense>
          <Contact />
        </div>
        <Footer />
      </div>
    </ThemeContext.Provider>

  );
}

export default App;
